window.bookSummaryJSON = "<p><b>Everyone dreams of reliving their life; we imagine what it might be be like to start over.</b></p> <p>But when Gwen Song awakes in her 15-year-old body, she finds herself in a world of urban sorcery. Though the problems of her troubled childhood remain, the familiar society she once lived in has all but disappeared and has been replaced by a parallel reality....</p>"; 
